              Card content
            </Card>
          </Col>
          <Col span={8}>
            <Card title="Card title" bordered={false}>
              Card content
            </Card>
          </Col>
        </Row>
      </div>
    </div>
  );
}

export default function IndexPage() {
  return (
    <div>
      <Stats></Stats>
    </div>
  );
}
